import React from 'react';

function MockPracticeSection() {
  return (
    <section className="mock-practice-section">
      <div className="container">
        <h3>Mock Practice</h3>
        <p>Practice interviews and assessments</p>
      </div>
    </section>
  );
}

export default MockPracticeSection;
